script: |
  super -f text -I q7969.spq | sort > q7969.out

inputs:
  - name: q7969.spq
    data: |
      SELECT DISTINCT + col2 AS col2, 40 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 82 NOT BETWEEN + + col1 / col1 * - + col2 AND + + col2;
  - name: tab0

outputs:
  - name: q7969.out
    data: |
      99	40
